import axios from 'axios';

export function consumeApi() {
    return (dispatch) => {
        return axios.post(`http://localhost:7000`)
            .then(response => {
                console.log('respuesta:',response);
                dispatch({
                    type: 'CONSUME_API_POST',
                    payload: response.data
                })
            })
            .catch(error => {
                throw (error);
            });
    }
}
